import React from "react";
import { BrowserRouter as Router, Routes, Route, useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import Adopt from "./Adopt";
import Shop from "./Shop";
import Gallery from './Gallery';
import ProductPage from './ProductPage';
import Board from './Board';
import Login from './Login';

import "./App.css";
import "./Carousel.css";

// Carousel component to show horizontal scroll of images with descriptions
function Carousel() {
  const images = [
    {
      src: "https://placeimg.com/320/240/animals",
      alt: "Adopt a pet",
      description: "Find loving pets ready for adoption."
    },
    {
      src: "https://placeimg.com/320/240/nature",
      alt: "Support shelters",
      description: "Support animal shelters through our shop."
    },
    {
      src: "https://placeimg.com/320/240/tech",
      alt: "Community Care",
      description: "Join our community to help animals."
    },
    {
      src: "https://placeimg.com/320/240/people",
      alt: "Events and visits",
      description: "Schedule visits and events with rescued pets."
    },
  ];

  return (
    <div className="carousel-container">
      {images.map(({ src, alt, description }, idx) => (
        <div className="carousel-item" key={idx}>
          <img src={src} alt={alt} className="carousel-img" />
          <p className="carousel-desc">{description}</p>
        </div>
      ))}
    </div>
  );
}

// Home page content as component
function Home() {
  const navigate = useNavigate();

  return (
    <div className="app">
      {/* Hero Section */}
      <section className="hero">
        <h2>Find Your New Best Friend</h2>
        <p>
          Whether you’re looking to adopt a furry companion or want to support animals through mindful shopping,
          Pawmise is here for you.
        </p>
        <button className="btn" onClick={() => navigate("/adopt")}>
          Get Started
        </button>
      </section>

      {/* Carousel describing the website */}
      <Carousel />

      {/* Cards Section */}
      <section className="cards">
        <div className="card" id="adopt">
          <h3>Adopt a Pet</h3>
          <p>Browse through adorable pets waiting for a loving home.</p>
          <button className="btn" onClick={() => navigate("/adopt")}>
            Adopt Now
          </button>
        </div>
        <div className="card" id="shop">
          <h3>Shop for a Cause</h3>
          <p>Every purchase supports rescue and shelter animals.</p>
          <button className="btn" onClick={() => navigate("/shop")}>
            Shop Now
          </button>
        </div>
      </section>
    </div>
  );
}

// Main App function
export default function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/shop" element={<Gallery />} />
        <Route path="/product/:id" element={<ProductPage />} />
        <Route path="/" element={<Home />} />
        <Route path="/adopt" element={<Adopt />} />
        <Route path="/shop" element={<Shop />} />
        <Route path="/login" element={<Login />} />
        <Route path="/board" element={<Board />} />
      </Routes>
    </Router>
  );
}
